import React from 'react';
import './styles.css';

function TotalTable({ cost }) {
  return (
    <table>
      <thead>
        <tr>
          <th>Total Cost</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>{cost}</td>
        </tr>
      </tbody>
    </table>
  );
}

export default TotalTable;
